two nights ago i got together with queen mary students who wanted to show their support for sexual abuse survivors for a finale to sex and relationships month. we made 5 banners that were all taken down within 3 hours by queen mary staff. though the banners may have been censored, we still want to spread the message. consent matters.
#metoo 
